    return (
        <>
            <div className='clubsList'>

                        <div className='eachClubBox'>
                            <div className="card">

                                <h1>Dummy Header</h1>
                                <p>Dummy details</p>
                                <p className="title">Dummy quote</p>


                                <p className='btn-visit'><button>Visit</button></p>
                            </div>
                        </div>





                

            </div>
        </>
    );
}

export default QuizDetails;
